import listRepository from "views/list-repository/list-repository.jsx";
import listFile from "views/list-file/list-file";
import Auth from 'withAuth';


let routes;

 let data = JSON.parse(localStorage.getItem('user'));




 if (data[0].IDLOGIN === 'TES0001') {
  routes =  [
    {
      path: "/index",
      name: "Master Report",
      icon: "ni ni-laptop text-blue",
      component: Auth(listRepository),
      layout: "/admin"
    },
    {
      path: "/listfile",
      name: "List File",
      icon: "ni ni-archive-2 text-red",
      component: Auth(listFile),
      layout: "/admin"
    },
    {
      path: "/inbox",
      name: "Inbox",
      icon: "ni ni-email-83 text-orange",
      component: listRepository,
      layout: "/admin"
    },
    {
      path: "/send",
      name: "Send File",
      icon: "ni ni-send text-green",
      component: listRepository,
      layout: "/admin"
    }]


 }else{
  routes =  [
    {
      path: "/index",
      name: "Master Report",
      icon: "ni ni-laptop text-blue",
      component: Auth(listRepository),
      layout: "/admin"
    },
    {
      path: "/listfile",
      name: "List File",
      icon: "ni ni-archive-2 text-red",
      component: Auth(listFile),
      layout: "/admin"
    },
    {
      path: "/inbox",
      name: "Inbox",
      icon: "ni ni-email-83 text-orange",
      component: listRepository,
      layout: "/admin"
    }]
 }

export default routes;
